import actions from './actions';
const { forget } = actions;

const forgetPassword = ({ username }) => {
    return async dispatch => {
        try {
        console.log(username);
        dispatch(forget(username));
        } catch (err) {
            console.log(err);
        }
        
    };
};

export { forgetPassword };
